            <div style={{"backgroundColor": "#bee3f8", "padding": "30px 0 40px 0"}}>                

                <br/>
                <b>Mindset Minsers 2023</b><br/>
                <div>DS/AI Hackathon</div><br/>
                <b>Team Members</b><br/>
                Hasan Baker, Sakhee Desai, Moath Erqsous, Abhishek Karwankar, Akash Parmar, Sharanjit Singh

            </div>
        </div>
    );
}

export default App;
